package com.kaiserkalep.bean;

/**
 * 滑块验证
 *
 * @Auther: Jack
 * @Date: 2020/12/3 19:39
 * @Description:
 */
public class CaptchaImageData {

    /**
     * bg : 
     * slide : 
     */

    /**
     * 背景图base64,无需验证时返回空
     */
    private String bg;
    /**
     * 滑块base64,无需验证时返回空
     */
    private String slide;
    private String errorMsg;
    private  String phone;

    private String type; //验证码类型：1滑块，2第三方顶象
    private String appId; //第三方id
    private String apiServer; //服务器接口地址
    /**
     * 无需验证时返回用于直接登录,需要验证时返回空(v1.1.0新增)
     */
    private String verificationCode;

    public String getVerificationCode() {
        return verificationCode;
    }

    public void setVerificationCode(String verificationCode) {
        this.verificationCode = verificationCode;
    }

    public String getErrorMsg() {
        return errorMsg;
    }

    public CaptchaImageData setErrorMsg(String errorMsg) {
        this.errorMsg = errorMsg;
        return this;
    }

    public String getBg() {
        return bg;
    }

    public void setBg(String bg) {
        this.bg = bg;
    }

    public String getSlide() {
        return slide;
    }

    public void setSlide(String slide) {
        this.slide = slide;
    }

    public String getPhone() {
        return phone;
    }

    public void setPhone(String phone) {
        this.phone = phone;
    }

    public String getType() {
        return type;
    }

    public void setType(String type) {
        this.type = type;
    }

    public String getAppId() {
        return appId;
    }

    public void setAppId(String appid) {
        this.appId = appid;
    }

    public String getApiServer() {
        return apiServer;
    }

    public void setApiServer(String apiServer) {
        this.apiServer = apiServer;
    }
}
